import { Fragment } from "react";

import classes from "./Header.module.css";

const Header = (props) => {
  return (
    <Fragment>
      <header>
        <h1>GoodFood</h1>
        <button>Cart</button>
      </header>
    </Fragment>
  );
};

export default Header;
